import React from 'react';
import Layout from './components/Layout';
import Modal from 'react-modal';

//Redux
import store from './redux/store';
import { Provider } from 'react-redux';

const App = () => {

  Modal.setAppElement('#root');

  return (
    <Provider store={store}>
      <Layout />
    </Provider>
  )
}

export default App;
